import React, { Component } from 'react';
import './App.css';
import { Button,  Container } from 'reactstrap';
import { Link } from 'react-router-dom';

const useStyles = makeStyles({
    container: {
      display: "flex",
      justifyContent: "center",
    },
  });

const classes = useStyles();

class Home extends Component {
    render() {
        return (
            <div class="jumbotron">

                <Container fluid className = {classes.container}>
                <h1 class = "pos_center">Welcome to Management System!</h1>
                <h4 class="pos_center"> Manage your employees and action items in all-in-one platform!</h4>

                    <Button class="button_example" size="lg" color="primary" tag={Link} to={"/Users"}>Users</Button>
                    <Button class="button_example" size="lg" color="warning" tag={Link} to={"/Tasks"}>Tasks</Button>



                </Container>
            </div>
        );
    }
}

export default Home
